import { Link } from "react-router-dom";
import { Button } from "react-bootstrap";
import "./Cabecalho.css"

export default function Cabecalho() {
  return (
    <header>
      <Link to="/" >
        <h2 className="titulo">Guia do emprendedor</h2>
      </Link>
      <div>
        <Link to="/produtos" style={{ textDecoration: 'none' }}>
          <Button variant="primary">Produtos</Button>
        </Link>
        <Link to="/cadastrar" className="linkC">
          <Button variant="primary" className="Btn" id='BtnNeg'>Cadastro</Button>
        </Link>
        <Link to="/clientes">
          <Button variant="primary">Clientes</Button>
        </Link>
      </div>
    </header>
  );
}
